Zürcher Gesundheitsdirektorin Nathalie Rickli will Gender Affirming Care für trans Jugendliche verbieten. 
🏳️‍⚧️ Es wird so getan, wie wenn massenweise Kinder und Teenies sich Operationen unterziehen - dabei betraff das in 2024 nur vier u18 Jährige.
🏳️‍⚧️ Auch der Zugang zu Pubertätsblocker soll eingeschränkt werden, dabei ist diese Behandlung für Jugendliche komplett reversibel. 

Wir bestärken das Recht jeder Person so zu leben, wie sie will - das betrifft auch die Genderidentität und das Recht auf geschlechtsangleichende Massnahmen.

